// contracts/Checkbook.sol
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Checkbook {
    address public owner;
    mapping(uint256 => bool) public issuedChecks;
    mapping(uint256 => bool) public verifiedChecks;
    mapping(uint256 => bool) public cashedChecks;

    event CheckIssued(uint256 checkNumber, address recipient, uint256 amount);
    event CheckVerified(uint256 checkNumber, address recipient);
    event CheckCashed(uint256 checkNumber, address recipient);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can execute this");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function issueCheck(uint256 checkNumber, address recipient, uint256 amount) external onlyOwner {
        require(!issuedChecks[checkNumber], "Check already issued");
        issuedChecks[checkNumber] = true;
        emit CheckIssued(checkNumber, recipient, amount);
    }

    function verifyCheck(uint256 checkNumber) external onlyOwner {
        require(issuedChecks[checkNumber], "Check not issued");
        require(!verifiedChecks[checkNumber], "Check already verified");
        verifiedChecks[checkNumber] = true;
        emit CheckVerified(checkNumber, msg.sender);
    }

    function cashCheck(uint256 checkNumber) external {
        require(issuedChecks[checkNumber], "Check not issued");
        require(verifiedChecks[checkNumber], "Check not verified");
        require(!cashedChecks[checkNumber], "Check already cashed");
        cashedChecks[checkNumber] = true;
        emit CheckCashed(checkNumber, msg.sender);
    }
}
